import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import App from "./App";
import Search from "./SearchBooks";

import "./index.css";

ReactDOM.render(
  <Router>
    <Routes>
      <Route exact path="/">
        <App />
      </Route>
      <Route path="/search">
        <Search />
      </Route>
    </Routes>
  </Router>,
  document.getElementById("root")
);
